import React from 'react';
import Login from './login'
import Upload from './upload'
import {BrowserRouter , Switch ,Route } from 'react-router-dom'

function App() {
  return (
    <div>
      <BrowserRouter>
      <Switch>
        <Route path='/login' exact component={()=><div>登录界面</div>} />
        <Route path='/upload' exact component={()=><div>上传界面</div>} />
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
